const BoxRight = (props) => {
    return (
        <div style={boxRightStyle}>
            <div>{props.id}</div>
            <div style={infoStyle}>
                <div> {Math.round(props.temp)} </div>
                <div> {props.description} </div>
            </div>
        </div>
    );
}

const boxRightStyle = {
    width: '100%',
    height: '15%',
    background: 'rgba(255, 255, 255, 0.8)',
    borderRadius: '25px',
    boxShadow: '5px 5px 10px 5px rgba(0,0,0,0.1)',
    display: 'flex',
